import React from 'react';
import './Avatar.css';
import Avatarlist from './Avatarlist';
import 'tachyons';
const Avatar = (props) => {

    const avatarlistarray = [
        {
            id:1,
            name:"priyanka",
            work:"web developer"
        }
    ]
    return ( 
    <div>
        <h1>welcome to Avatar world</h1>
        <Avatarlist id="1" name={avatarlistarray[0].name}
         work={avatarlistarray[0].work} />
        <Avatarlist id="1" name="priti" work="Teacher"/>
        <Avatarlist id="1" name="amol" work="anylist"/>
        <Avatarlist id="1" name="aakash" work="ui developer"/>
        <button> Subcribe</button>
        </div>
    )
}
export default Avatar;
